import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/login">
                    <Login />
                </Route>
                <Route path="/signup">
                    <Signup />
                </Route>
                <Route path="/dashboard">
                    <Dashboard />
                </Route>
                {/* More routes here */}
            </Switch>
        </Router>
    );
}

export default App;
